using System;
using System.Collections.Generic;
using System.Linq;
using isntservice.Models;

namespace isntservice.Services {
    public class PostService {
        private List<PostModel> DummyPosts = new List<PostModel>();

        private PostModel DummyPostGen(string id, string userId, string body, string imgurl){
            return new PostModel{
                Id = Guid.Parse(id),
                UserId = Guid.Parse(userId),
                ImageURL = imgurl,
                Body = body,
                Created = DateTime.Now
            };
        }

        public PostService(){
            DummyPosts.Add(DummyPostGen("02d8120a-ab01-4166-8877-31b3b50ed7f9","0728a190-c8ca-4da9-ba6f-e69dc2380acc","My waifu","https://cdn.vox-cdn.com/thumbor/w4FwM7COtIUccr7166om7ty6o6U=/0x0:2048x1365/1200x800/filters:focal(861x520:1187x846)/cdn.vox-cdn.com/uploads/chorus_image/image/63577255/56973906_1031440620389086_5150401069125206016_o.0.jpg"));
            DummyPosts.Add(DummyPostGen("b3787c6e-b048-49b0-8b4d-906999ca010e","2e1fa959-06c6-4fac-838d-bed9e6a768bf","My waifu","data:image/jpeg;base64,"));


            DummyPosts.Add(DummyPostGen("998a8b4e-4a4d-4da5-96e1-6b0cb1a440a5","998a8b4e-4a4d-4da5-96e1-6b0cb1a440a4","My WIFI", "data:image/jpeg;base64,"));
        }
        public List<PostModel> Get(){
            return DummyPosts;
        }

        public PostModel Get(Guid id){
            return DummyPosts.SingleOrDefault(p => p.Id == id);
        }
    }
}